input: [['i', '.', '.'], ['i', 'i', 'i'], ['i', 'i', 'i']]
output: [['.', 'i', 'i'], ['.', 'i', 'i'], ['i', 'i', 'i']]

Example_2:
input: [['f', 'f', 'f'], ['.', '.', '.'], ['f', 'f', '.']]
output: [['f', '.', '.'], ['f', '.', 'f'], ['f', '.', 'f']]

Example_3:
input: [['.', '.', 'i'], ['.', '.', 'i'], ['i', 'i', 'i']]
output: [['i', 'i', 'i'], ['.', '.', 'i'], ['.', '.', 'i']]

Example_4:
input: [['b', '.', 'b'], ['.', '.', 'b'], ['.', 'b', 'b']]
output: [['b', 'b', 'b'], ['.', '.', 'b'], ['b', '.', '.']]

Test case:
input: [['.', '.', '.'], ['e', '.', '.'], ['.', 'e', 'e']]

###########################################################
Sample Outputs:
output: [['.', '.', '.'], ['.', '.', 'e'], ['.', '.', 'e']]
*/

public class Solution {
    public char[][] updateBoard(char[][] board, int[] click) {
        if (board[click[0]][click[1]] == 'M') {
            board[click[0]][click[1]] = 'X';
            return board;
        }
        dfs(board, click[0], click[1]);
        return board;
    }

    private void dfs(char[][] board, int x, int y) {
        if (x < 0 || x >= board.length || y < 0 || y >= board[0].length || board[x][y]!= '.') {
            return;
        }
        int count = getCount(board, x, y);
        if (count > 0) {
            board[x][y] = (char)(count + '0');
            return;
        }
        board[x][y] = 'B';
        for (int i = -1; i <= 1; ++i) {
            for (int j = -1; j <= 1; ++j) {
                dfs(board, x + i, y + j);
            }
        }
    }

    private int getCount(char[][] board, int x, int y) {
        int count = 0;
        for (int i = -1; i <= 1; ++i) {
            for (int j = -1; j <= 1; ++j) {
                if ((i!= 0 || j!= 0) && board[x + i][y + j] == 'M') {
                    count++;
                }
            }
        }
        return count;
    }
}
